import React, {Component} from "react";

class Header extends Component {
    constructor(props){
        super(props);
    }
    render() {
        return (
            <div class="ts large link attached inverted info menu">
                <div id="mynavbar" class="ts container">
                    <div class="ts grid">
                    <h1 id="sproutheader">
                    Sprout Farm!
                    </h1>
                    <h1 id="white_font">
                    {this.props.current_time}
                    </h1>
                    </div>
                </div>
            </div>
        )
    }
}

export default Header
